"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[53],{1109:function(e){e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Quick Start","href":"/quick-start","docId":"quick-start"},{"type":"link","label":"Step-by-Step Tutorial","href":"/tutorial","docId":"tutorial"},{"type":"category","label":"Manage","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Assets","href":"/manage/assets","docId":"manage/assets"},{"type":"link","label":"Site Elements","href":"/manage/site-elements","docId":"manage/site-elements"},{"type":"link","label":"Authoring","href":"/manage/authoring","docId":"manage/authoring"},{"type":"link","label":"Create a Page","href":"/manage/create-page","docId":"manage/create-page"},{"type":"link","label":"Publishing","href":"/manage/publish","docId":"manage/publish"}],"href":"/manage/"},{"type":"category","label":"Customize","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Theme Sources","href":"/customize/theme-sources","docId":"customize/theme-sources"},{"type":"link","label":"Helpful Links","href":"/customize/helpful-links","docId":"customize/helpful-links"},{"type":"link","label":"Change Theme","href":"/customize/change-theme","docId":"customize/change-theme"},{"type":"link","label":"Style System","href":"/customize/style-system","docId":"customize/style-system"}]}]},"docs":{"customize/change-theme":{"id":"customize/change-theme","title":"Change Theme","description":"The Tailwind AEM Site Template comes with two themes: Wireframe and WKND. It\'s quite easy to swap themes and only three lines of code to change. It\'s easiest to see this in action while running the live editing mode.","sidebar":"tutorialSidebar"},"customize/helpful-links":{"id":"customize/helpful-links","title":"Helpful Links","description":"- AEM Quick Site Creation Journey","sidebar":"tutorialSidebar"},"customize/style-system":{"id":"customize/style-system","title":"Style System","description":"As a best practice, all Style System variations should be in their own file. Additionally, it is recommended to follow the BEM syntax when naming classes for use with the Style System. This must be coordinated with the classnames entered into the Style System within AEM, or the Style System classnames must be managed in code. For instance, you will find several variations for the teaser component that follow the BEM model in the Wireframe theme:","sidebar":"tutorialSidebar"},"customize/theme-sources":{"id":"customize/theme-sources","title":"Theme Sources","description":"To get theme sources from AEM, it\'s easiest to follow this short video from Adobe.","sidebar":"tutorialSidebar"},"manage/assets":{"id":"manage/assets","title":"Assets","description":"Adobe Experience Manager (AEM) Assets is a digital asset management tool on the AEM Platform that allows users to create, manage, and share their digital assets (images, videos, documents, and audio clips) in a web-based repository.","sidebar":"tutorialSidebar"},"manage/authoring":{"id":"manage/authoring","title":"Authoring","description":"Depending upon your role within your organization, you might spend most of your time creating and authoring pages. Let\'s learn how to update the content on the homepage that comes with the Tailwind AEM Site Template.","sidebar":"tutorialSidebar"},"manage/create-page":{"id":"manage/create-page","title":"Create a Page","description":"Creating a Page is one of the most fundamental aspects of authoring in AEM. Navigate to the root of your Demo site, then \'en\'. Click the Create button in the top right, and select Page. We\'re going to make an FAQ page.","sidebar":"tutorialSidebar"},"manage/manage":{"id":"manage/manage","title":"Manage your Site","description":"AEM provides the power and flexibility to build any type of site you would like. This guide to Managing your Site will help you understand how to implement Assets, Site Elements (Headers/Footers), Authoring, Creating and Publishing a Page. To learn more on advanced topics like CSS and template changes, continue on to the Customize guide.","sidebar":"tutorialSidebar"},"manage/publish":{"id":"manage/publish","title":"Publishing","description":"Publishing your Site for the first time will take a few simple steps. Let\'s start by navigating to the root of your Site and selecting the checkbox for your Demo site. This will bring up the context menu at the top of the page. Select Manage Publication.","sidebar":"tutorialSidebar"},"manage/site-elements":{"id":"manage/site-elements","title":"Site Elements","description":"The Header & Footer are complex and crucial elements of your Site. The Tailwind AEM Site Template comes with one responsively designed Header & Footer that look great on your phone, tablet, and PC.","sidebar":"tutorialSidebar"},"quick-start":{"id":"quick-start","title":"Quick Start","description":"Let\'s discover the Tailwind AEM Site Template by creating a new Site in less than 5 minutes.","sidebar":"tutorialSidebar"},"tutorial":{"id":"tutorial","title":"Step-by-Step Tutorial","description":"Welcome to the Tailwind AEM Site Template Step-by-Step Tutorial. This is meant for people who like to learn by doing. The Tutorial will guide you from code checkout to site publication in AEM.","sidebar":"tutorialSidebar"}}}')}}]);